import math

def calculate_gcd_of_lcm_pairs(n, a):
    dp = [0] / (n + 1)
    ans = [0] * (n + 1)
    dp[n] = a[n - 1]
    for i in range(n - 1, 0, -1):
        dp[i] = math.gcd(a[i - 1], dp[i + 1])
    for i in range(1, n):
        ans[i] = int(a[i - 1] * dp[i + 1] / math.gcd(a[i - 1], dp[i + 1]))
    tot = ans[1]
    for i in range(2, n + 1):
        tot = math.gcd(tot, ans[i])
    return tot

